const removeDuplicates = (s, k) => {
  let stack = [];

  for (let j = 0; j < s.length; j++) {
    let current = s[j];
    let top = stack.pop();
    if (top && current === top.char) {
      if (top.count + 1 < k) stack.push({ char: current, count: top.count + 1 });
    } else {
      if (top) stack.push(top);
      stack.push({ char: current, count: 1 });
    }
  }

  let result = '';
  stack.forEach((item) => {
    for (let i = 1; i <= item.count; i++) result += item.char;
  });
  return result;
};

console.log(removeDuplicates('deeedbbcccbdaa', 3)); // aa
console.log(removeDuplicates('abcd', 2)); // abcd
console.log(removeDuplicates('pbbcggttciiippooaais', 2)); //ps
console.log(
  removeDuplicates(
    '',
    2
  )
);
